// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./Game.sol";

abstract contract Admin is Ownable, Game {
    address admin;

    event changeAdmin(address indexed admin);

    event changePointLevel(uint256 level, uint256 amount);

    event changeAllLevel(uint256 amount);

    event sendSlotsPlayer(address indexed player);

    event createSkillsEvent(
        uint256 indexed idSkill,
        string indexed name,
        uint256 price
    );

    constructor(address _admin) {
        admin = _admin;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "just admin can do it!");
        _;
    }

    using SafeMath for uint256;

    function setAdmin(address _admin) public onlyAdmin {
        admin = _admin;
        emit changeAdmin(_admin);
    }

    function setAmountToJoin(uint256 _amountToJoin)
        public
        onlyAdmin
        returns (uint256)
    {
        amountToJoin = _amountToJoin;
        return _amountToJoin;
    }

    function setPointLevel(uint256 _level, uint256 _amount)
        public
        onlyAdmin
        returns (bool)
    {
        Level[_level] = _amount;
        emit changePointLevel(_level, _amount);
        return true;
    }

    // function setPointAll() public view onlyAdmin returns (bool) {
    //     for (uint256 i = 0; i < Player.length; i++) {
    //         GameLevel.pointAll.add(Player[i].points);
    //     }
    //     return true;
    // }

    function setAllLevel(uint256 _amount) public onlyAdmin returns (bool) {
        GameLevel.allLevel = _amount;
        emit changeAllLevel(_amount);
        return true;
    }

    function sendSlotsToPlayer(address _player) public onlyAdmin {
        emit sendSlotsPlayer(_player);
    }

    function createSkills(
        uint256 _idSkill,
        string memory _name,
        uint256 _price
    ) public onlyAdmin {
        Skills memory _skill = Skills({
            name: _name,
            price: _price,
            idSkill: _idSkill,
            disabled: true
        });
        SkillGame.push(_skill);
        idSkills[_idSkill] = _skill;
        emit createSkillsEvent(_idSkill, _name, _price);
    }
}
